  namespace: Microsoft.Health.InvertedIndex
  summary: "\nIndex List allows us to control the rate at which it grows. Default framework\nlists grow by doubling their size. That is not always good, especially with huge lists,\nwhich will end up with considerable empty space. \n\nHere, we amortize growth rate vs the benefits of 'doubling'.\nInitially, we grow quickly, by doubling the list size. Once we hit a threshold, we slow down\nthe growth rate and only grow by fixed deltas. \n\n"
